import Link from "next/link";

const nav = () => {
    return (
        <nav className="d-flex justify-content-between align-items-center pl-3 pr-3">
            <Link href="/"><a href="">홈</a></Link>
            <div className="header__navitem">
                <a>랭킹</a>
            </div>
            <div className="header__navitem">
                <a>통계</a>
            </div>
            <div className="header__navitem">
                <a>소식</a>
            </div>
        </nav>
    );
};

export default nav;
